import React from "react";
import "./Product.css";

export default function Product(props) {
  return (
    <div className="Product">
      <div className="frame-img">
        <img src={props.img} alt={props.name} />
      </div>
      <div className="info"></div>
      <p>{props.name}</p>
    </div>
  );
}
